type IBtnProps = {
    border: string;
    color: string;
    children: React.ReactNode;
    height: string;
    width: string;
    onClick?: () => void;
    radius: string
};

const Primary = (props: IBtnProps) => {
    return (
        <button
            style={{
                border: props.border,
                color: props.color,
                height: '40px',
                width: '100px',
                borderRadius: '30%',
            }}
        >{props.children}</button>
    );
};

const Secondary = (props: IBtnProps) => {
    return (
        <button>{props.children}</button>
    );
};

const Buttons = { Primary, Secondary }
export default Buttons;
